import Menu from "./Menu";
import {HashLink} from 'react-router-hash-link';
export default function Phonenav({toggle}){
   const crte = '//';
   return (
      <div className="phonenav" > 
      <div className="phonemeni"><Menu toggle={toggle}/></div>
      
         <ul className="nav__links nesto">
            <li className="razmak"><HashLink to="pocetak" ><span>{crte}</span>  O nama</HashLink></li>
            <li className="razmak"><HashLink to="pocetak" ><span>{crte}</span>  Proizvodi</HashLink></li>
            <li className="razmak"><HashLink to="pocetak"><span>{crte}</span>&nbsp;Vrste&nbsp;kamena</HashLink></li>
            <li className="razmak"><HashLink to="pocetak"><span>{crte}</span>  Kontakt</HashLink></li>
         </ul>  
      </div>
   )
}
